import React from "react";
import "./wyniki.css";
import Card from "../UI/Card";

function Wyniki(props) {
  return (
    <li>
      <div>
        <div>
          <ul>
            {props.kurwa.map((lista) => (
              <Card>
                <li>
                  {lista.NAME} {lista.AGE}
                </li>
              </Card>
            ))}
          </ul>
        </div>
      </div>
    </li>
  );
}

export default Wyniki;
